// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CommissionManager {
    address public admin;
    uint256 public platformCommission;
    uint256 public promoterCommission;
    address public platformAddress;
    address public promoterAddress;

    constructor(
        uint256 _platformCommission,
        uint256 _promoterCommission,
        address _platformAddress,
        address _promoterAddress
    ) {
        require(_platformAddress != address(0), "Invalid platform address");
        require(_promoterAddress != address(0), "Invalid promoter address");

        admin = msg.sender;
        platformCommission = _platformCommission;
        promoterCommission = _promoterCommission;
        platformAddress = _platformAddress;
        promoterAddress = _promoterAddress;
    }

    function setPlatformCommission(uint256 newCommission) external {
        require(msg.sender == admin, 'only admin can set commission');
        platformCommission = newCommission;
    }

    function setPromoterCommission(uint256 newCommission) external {
        require(msg.sender == admin, 'only admin can set commission');
        promoterCommission = newCommission;
    }

    function setPlatformAddress(address newAddress) external {
        require(msg.sender == admin, 'only admin can set platform address');
        require(newAddress != address(0), "Invalid platform address");
        platformAddress = newAddress;
    }

    function setPromoterAddress(address newAddress) external {
        require(msg.sender == admin, 'only admin can set promoter address');
        require(newAddress != address(0), "Invalid promoter address");
        promoterAddress = newAddress;
    }

    function getPlatformCommission() external view returns (uint256) {
        return platformCommission;
    }

    function getPromoterCommission() external view returns (uint256) {
        return promoterCommission;
    }
}
